<h1 style="border-style: none none dashed solid;
border-color: #2A96D4;
border-width: medium medium 1px 5px;
padding: 10px 15px;
margin-bottom: 1em;
background-color: transparent;
width:580px;
background:#F3F3F3;
font-weight: bold;
color:#0080BD;
text-align:left;
font-size: 14px">大型 壁掛け扇風機　［リモコン付き テクノス KI-W478R］</h1>
　
<table width="550" border="0" cellpadding="0" cellspacing="0" align="center" style="line-height:1.7;font-size:13px;">
  <tr>
    <td><img src="http://image.rakuten.co.jp/mckey/cabinet/navy2/6696kttd120410-01.jpg" alt="壁掛け扇風機テクノス KI-W478R" width="550" height="550"><br>
        <br>
      <br>  
        <strong style="color:#0080BD;font-size:15px;">大型 壁掛け扇風機　テクノス KI-W478R　リモコンタイプ</strong><br>
      テクノス（TEKNOS）の壁に取り付けるタイプの大型扇風機です。一般的なリビング用扇風機の羽根の直径が約30cmに対して、この壁掛け扇風機の羽根は直径40cmと大きい羽根が付いております。遠くまで涼しい風を送り出す事ができます。40センチのプロペラファン5枚羽仕様となります。<br>
      リモコン付きのタイプで高い場所に取り付けられた場合の操作に便利です。リモコンではモード切替、首振り、タイマー、風量の全ての操作を行うことができます。<br>
      壁掛けタイプは省スペースですので、扇風機の置き場所のない狭い場所での使用に便利です。また、大型のため、学校・体育館・工場・倉庫・オフィス事務所などの業務用としてもお使い頂けます。<br>
      <br>
      <br>
        <strong style="color:#0080BD;font-size:15px;">大型 壁掛け扇風機のエコな使い方（１）<br>
        窓際に置いて涼しい外気を取り込もう。</strong><br>
        夏場、部屋から外に出てみると「あれ、外のほうが涼しい？」と感じたことはないでしょうか。部屋の温度よりも外気のほうが涼しくなっている場合は、窓の近くに壁掛け扇風機を設置することで外気を部屋に取り込んでみましょう。やり方は簡単、壁掛け扇風機を窓の近くの位置に設置し、反対向きの空気の流れが生じないよう窓を締め気味にすればOKです。その他には、ドアを全開にして風通しを良くし、風が抜ける場所の途中に扇風機を設置するのも効果的です。<br>
        <br>
        <strong style="color:#0080BD;font-size:15px;">大型 壁掛け扇風機のエコな使い方（２）<br>
2台使うなら置き方を工夫してみよう。</strong><br>
家に扇風機がもう１台あるという人は、置き方を工夫してみましょう。真正面と真後ろから身体を挟み込むように置いてしまうと、風が全体に行き渡りません。下と上に空気の流れを作れば、2台分の風が体を包み込むように流れます。<br>
        <br>
        <strong style="color:#0080BD;font-size:15px;">大型 壁掛け扇風機のエコな使い方（3）<br>
エアコンを使う場合も壁掛け扇風機が活躍。</strong><br>
エアコンの冷気は、そのままだと床付近に溜まってしまいがち。熱気が一番溜まっている部屋の上部に壁掛け扇風機を設置して、空気を部屋中に循環させましょう。エアコンの温度設定を低くするより、電気代の節約にもなるのでオススメです。</td>
  </tr>
</table>
<br>
<br>
<br>
